description:
Lusty Professor Andre Thomspon is about to marry a delicious young cream puff named Bonnie. But before he does, some of his former students are going to put him through an avalanche of hot HARD CHOICES! First there's Denise, who &quot;had&quot; the professor in college, and would like another torrid taste. Then there's gorgeous Evelyn, the homecoming queen who needs her pom-poms twirled. Meggie and Gabby (who's developed a peculiar habit!) get an &quot;A&quot; for their debauched dildo cramming. And even little Bonnie takes on a stiff stud in a case of erotic indecision. At the end, when the music plays &quot;Here Comes The Bride&quot;, you'll wonder... &quot;Who hasn't?&quot;

